import Btn from './Btn.js';

const navigation = [
  { name: 'New Game', href:'', img:'', classes:'' ,current: false },
  { name: 'Join', href:'', img:'', classes:'' ,current: false },
  { name: 'Tournament', href:'', img:'', classes:'' ,current: false },
  { name: 'Connect', href:'', img:'', classes:'ml-4' ,current: true },
  { name: 'Profile', href:'', img:'', classes:'', current:false }
]

export default function Header() {
  return (
    <div className="Header-Child">
      { 
        navigation.map((btn)=>{ 
          return(
            <Btn key={btn.name.toLowerCase()} name={btn.name} href={btn.href} img={btn.img} current={btn.current} />
          );
        })
      }
    </div>
  );
}
